import React, { useState } from "react";
import "./Profile.css"; // External CSS file

const Profile = () => {
    const [username, setUsername] = useState("Username");
    const [email, setEmail] = useState("username@gmail.com");
    const [phoneNumber, setPhoneNumber] = useState("+63");
    const [foodPreferences, setFoodPreferences] = useState([
        "Vegetarian", "Meat", "Fastfood"
    ]);

    const handleSaveChanges = () => {
        // Logic to save changes
        alert("Changes saved!");
    };

    const handleAddPreference = () => {
        setFoodPreferences([...foodPreferences, ""]);
    };

    return (
        <div className="profile-container">
            <div className="profile-header">
                <h2>Hello, {username}!</h2>
                <p>Manage your account and personalize your experience</p>
            </div>

            <div className="profile-info">
                <div className="profile-photo">
                    <img src="profile-icon.svg" alt="Profile" />
                    <button className="edit-icon">✏️</button>
                </div>
                <div className="profile-details">
                    <div className="detail-item">
                        <label htmlFor="username">Username</label>
                        <input
                            type="text"
                            id="username"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                    </div>
                    <div className="detail-item">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                        />
                    </div>
                    <div className="detail-item">
                        <label htmlFor="phone">Phone Number</label>
                        <input
                            type="tel"
                            id="phone"
                            value={phoneNumber}
                            onChange={(e) => setPhoneNumber(e.target.value)}
                        />
                    </div>
                    <button className="save-changes-btn" onClick={handleSaveChanges}>Save Changes</button>
                    <button className="logout-btn">Logout</button>
                </div>
            </div>

            <div className="food-preferences">
                <h3>Food Preferences</h3>
                <div className="preferences-list">
                    {foodPreferences.map((pref, index) => (
                        <input
                            key={index}
                            type="text"
                            value={pref}
                            onChange={(e) => {
                                const newPreferences = [...foodPreferences];
                                newPreferences[index] = e.target.value;
                                setFoodPreferences(newPreferences);
                            }}
                        />
                    ))}
                    <button className="add-preference-btn" onClick={handleAddPreference}>+ Add Preferences</button>
                </div>
            </div>
        </div>
    );
};

export default Profile;
